import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import ProtectedRoute from "./components/ProtectedRoute";
import AdminLayout from "./layouts/AdminLayout"; // or your main dashboard layout
import ModelLayout from "./layouts/ModelLayout";
import AgencyLayout from "./layouts/AgencyLayout";
import ClientLayout from "./layouts/ClientLayout";
import Login from "./pages/Login";
import Logout from "./pages/Logout";

// Example using nested routes
function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Public Routes */}
        <Route path="/login" element={<Login />} />
        <Route path="/logout" element={<Logout />} />

        {/* Protected Routes - All dashboards */}
        <Route
          path="/*"
          element={
            <ProtectedRoute>
              <MainRouter />
            </ProtectedRoute>
          }
        />

        {/* Fallback */}
        <Route path="*" element={<Navigate to="/login" replace />} />
      </Routes>
    </BrowserRouter>
  );
}

// Separate component for role-based routing inside protected area
const MainRouter = () => {
  const { user } = useSelector((state) => state.auth);
  const role = user?.role?.toLowerCase();

  switch (role) {
    case "admin":
      return <AdminLayout />; // Contains Sidebar + Outlet for admin pages
    case "model":
      return <ModelLayout />;
    case "agency":
      return <AgencyLayout />;
    case "client":
      return <ClientLayout />;
    default:
      return <Navigate to="/login" replace />;
  }
};

export default App;
